import React from 'react';
import './TimelineStyles.css';

const InternshipSection = () => {
  return (
    <section id="internships" className="timeline-container">
      <h2 className="timeline-title">My Internships</h2>
      <div className="timeline-line"></div>

      <div className="timeline-item left">
        <div className="timeline-dot"></div>
        <div className="timeline-card">
          <h3>Software Developer Intern – Smart Desert Pvt Ltd</h3>
          <p>Jul 2021 – Dec 2021</p>
          <p>Created wireframes and high-fidelity mockups... code reviews and documentation.</p>
        </div>
      </div>

      <div className="timeline-item right">
        <div className="timeline-dot"></div>
        <div className="timeline-card">
          <h3>Teaching Assistant – SUNY New Paltz</h3>
          <p>Jan 2024 – May 2024</p>
          <p>Built a full-stack AI-powered grading website... with Tableau/Power BI reporting.</p>
        </div>
      </div>
    </section>
  );
};

export default InternshipSection;
